import React, { Component } from 'react'
import AppNavbar from './components/AppNavbar'
import MaterialList from './components/MaterialList'
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <AppNavbar/>
        <MaterialList/>
      </div>
    );
  }
}

export default App
